import React, { useState, useEffect } from 'react';
import {
  AppBar, Toolbar, Typography, Button, Box, Drawer, IconButton, List, ListItem,
  ListItemText, ListItemIcon, CssBaseline, Grid, Paper, Avatar, Dialog,
  DialogActions, DialogContent, DialogTitle, TextField, Chip, ListItemAvatar
} from '@mui/material';
import { Menu, People, Group, Event, AttachMoney, Logout } from '@mui/icons-material';
import { Link, useNavigate } from 'react-router-dom';
import Cookies from 'js-cookie';
import api from '../utils/api';

const drawerWidth = 240;

const AdminDashboard = () => {
  const [mobileOpen, setMobileOpen] = useState(false);
  const [adminCount, setAdminCount] = useState(0);
  const [playerCount, setPlayerCount] = useState(0);
  const [addAdminDialogOpen, setAddAdminDialogOpen] = useState(false);
  const [newAdminData, setNewAdminData] = useState({ name: '', email: '', password: '' });
  const [error, setError] = useState('');
  const [successMessage, setSuccessMessage] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchAdminCount = async () => {
      try {
        const response = await api.get('/admin/count');
        setAdminCount(response.data.count);
      } catch (error) {
        console.error('Error fetching admin count:', error);
        setError('Failed to load admin count.');
      }
    };
    const fetchPlayerCount = async () => {
      try {
        const response = await api.get('/players/count');
        setPlayerCount(response.data.count);
      } catch (error) {
        console.error('Error fetching player count:', error);
        setError('Failed to load player count.');
      }
    };
    fetchAdminCount();
    fetchPlayerCount();
  }, []);

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const handleLogout = () => {
    Cookies.remove('token');
    Cookies.remove('admin');
    navigate('/login');
  };

  const handleAddAdminDialogOpen = () => {
    setAddAdminDialogOpen(true);
  };

  const handleAddAdminDialogClose = () => {
    setAddAdminDialogOpen(false);
    setNewAdminData({ name: '', email: '', password: '' });
    setError('');
    setSuccessMessage('');
  };

  const handleNewAdminDataChange = (e) => {
    setNewAdminData({ ...newAdminData, [e.target.name]: e.target.value });
  };

  const handleCreateNewAdmin = async () => {
    try {
      const response = await api.post('/admin/register', newAdminData);
      if (response.status === 201) {
        setSuccessMessage('Admin added successfully!');
        setAddAdminDialogOpen(false);
      } else {
        setError(response.data.message || 'Failed to add admin');
      }
    } catch (error) {
      console.error('Error creating admin:', error);
      setError(error.response?.data?.message || 'Failed to add admin');
    }
  };

  const drawer = (
    <Box sx={{ width: drawerWidth }}>
      <Toolbar />
      <List>
        <ListItem button component={Link} to="/dashboard">
          <ListItemIcon><People /></ListItemIcon>
          <ListItemText primary="Dashboard" />
        </ListItem>
        <ListItem button component={Link} to="/players">
          <ListItemIcon><Group /></ListItemIcon>
          <ListItemText primary="Players" />
        </ListItem>
        <ListItem button component={Link} to="/auctions">
          <ListItemIcon><Event /></ListItemIcon>
          <ListItemText primary="Auctions" />
        </ListItem>
        <ListItem button onClick={handleLogout}>
          <ListItemIcon><Logout /></ListItemIcon>
          <ListItemText primary="Logout" />
        </ListItem>
      </List>
    </Box>
  );

  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar position="fixed" sx={{ width: { sm: `calc(100% - ${drawerWidth}px)` }, ml: { sm: `${drawerWidth}px` } }}>
        <Toolbar>
          <IconButton color="inherit" edge="start" onClick={handleDrawerToggle} sx={{ display: { sm: 'none' } }}>
            <Menu />
          </IconButton>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>Admin Cricket Auction</Typography>
        </Toolbar>
      </AppBar>

      {/* Sidebar */}
      <Box component="nav" sx={{ width: { sm: drawerWidth }, flexShrink: { sm: 0 } }}>
        <Drawer
          variant="temporary"
          open={mobileOpen}
          onClose={handleDrawerToggle}
          ModalProps={{ keepMounted: true }}
          sx={{ display: { xs: 'block', sm: 'none' } }}
        >
          {drawer}
        </Drawer>
        <Drawer variant="permanent" sx={{ display: { xs: 'none', sm: 'block' }, width: drawerWidth }}>
          {drawer}
        </Drawer>
      </Box>

      {/* Main Content */}
      <Box component="main" sx={{ flexGrow: 1, p: 3, width: { sm: `calc(100% - ${drawerWidth}px)` } }}>
        <Toolbar />
        <Grid container spacing={3}>
          <Grid item xs={12} sm={6} md={3}>
            <Paper sx={{ p: 2, display: 'flex', alignItems: 'center' }}>
              <Avatar sx={{ bgcolor: 'info.main', mr: 2 }}><People /></Avatar>
              <Box>
                <Typography variant="h6">Total Admins</Typography>
                <Typography>{adminCount}</Typography>
              </Box>
            </Paper>
          </Grid>
          <Grid item xs={12} sm={6} md={3}>
            <Paper sx={{ p: 2, display: 'flex', alignItems: 'center' }}>
              <Avatar sx={{ bgcolor: 'primary.main', mr: 2 }}><Group /></Avatar>
              <Box>
                <Typography variant="h6">Total Players</Typography>
                <Typography>{playerCount}</Typography>
              </Box>
            </Paper>
          </Grid>
        </Grid>
        <Button variant="contained" color="primary" onClick={handleAddAdminDialogOpen} sx={{ mt: 3 }}>
          Add New Admin
        </Button>

        {/* Add Admin Dialog */}
        <Dialog open={addAdminDialogOpen} onClose={handleAddAdminDialogClose}>
          <DialogTitle>Add New Admin</DialogTitle>
          <DialogContent>
            {error && <Typography color="error">{error}</Typography>}
            {successMessage && <Typography color="success">{successMessage}</Typography>}
            <TextField name="name" label="Name" fullWidth margin="dense" value={newAdminData.name} onChange={handleNewAdminDataChange} />
            <TextField name="email" label="Email Address" fullWidth margin="dense" value={newAdminData.email} onChange={handleNewAdminDataChange} />
            <TextField name="password" label="Password" type="password" fullWidth margin="dense" value={newAdminData.password} onChange={handleNewAdminDataChange} />
          </DialogContent>
          <DialogActions>
            <Button onClick={handleAddAdminDialogClose}>Cancel</Button>
            <Button onClick={handleCreateNewAdmin}>Create</Button>
          </DialogActions>
        </Dialog>
      </Box>
    </Box>
  );
};

export default AdminDashboard;
